import React from 'react';
import { AuthProvider } from './context/AuthContext';
import AppRoutes from './routes/AppRoutes';

function App() {
    return (
        // The AuthProvider wraps everything so all components can access auth state
        <AuthProvider>
            <AppRoutes />
        </AuthProvider>
    );
}

export default App;
